import React from 'react'
import PropTypes from 'prop-types'

function Job_list(props) {
    return (
        <>
        <tr>
            <td>{props.job.id}</td>
            <td>{props.job.title}</td>
            <td>{props.job.company}</td>
            <td>{props.job.place}</td>
            <td>{props.job.time}</td>
            </tr>
        </>
    )
}

Job_list.propTypes = {

}

export default Job_list
